@lrdthecompany “LOST ONES” OUT NOW! 🍎 
Full video on @youtube 
#alexfetbrothchoreography 

I’ve had the honor of training this phenomenal group of artists for a few years now to the point we’re like family. When @junehinojosa2.0 called me to conceptualize, direct, and choreograph a video specifically for the group I was on board right away.

This video is about empowerment and representing the city of Laredo through this upcoming generation of awesome human-beings. 

Coming to Laredo, TX over the years has brought me so much joy and it’s so cool to see this group’s growth. Each competition, convention, and accomplishment all derive from the hard-work they put in from home. 

To my LRD Fam, no matter where you go in life, we’ll  always have this piece as a documented memory in time. All the love! 

Directed, Choreographed, and Creative: #alexfetbroth 
Videographer: @pabs.crowned 
